import React from 'react';
import { createRoot } from 'react-dom/client'; // Importando de react-dom/client
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';


// Criar a raiz do React usando createRoot
const root = createRoot(document.getElementById('root'));

root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
